import { StatusBar } from "expo-status-bar";
import React, { useState } from "react";
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import {
    StyleSheet,
    Text,
    View,
    Image,
    TextInput,
    Button,
    Alert,
    TouchableOpacity,
} from "react-native";



function loginScreen({navigation}) {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    return (
        <View style={styles.container}>


            <Image style={styles.image} source={require("./assets/lightningbolt3.png")} />
            <Text style = {styles.bigText}> Power Smart</Text>
            <StatusBar style="auto" />
            <View style={styles.inputView}>
                <TextInput
                    style={styles.TextInput}
                    placeholder="Email"
                    placeholderTextColor="#003f5c"
                    onChangeText={(email) => setEmail(email)}
                />
            </View>

            <View style={styles.inputView}>
                <TextInput
                    style={styles.TextInput}
                    placeholder="Password"
                    placeholderTextColor="#003f5c"
                    secureTextEntry={true}
                    onChangeText={(password) => setPassword(password)}
                />
            </View>

            <TouchableOpacity>
                <Text style={styles.forgot_button}>Forgot Password?</Text>
            </TouchableOpacity>

            <TouchableOpacity style={styles.loginBtn}>
                <Button
                    title="Login"
                    onPress={() => navigation.navigate('Home')}
                />
            </TouchableOpacity>

        </View>
    );
}

function homeScreen({ navigation }) {
    return (
        <View style= {styles.container}>
            <Image style={styles.image} source={require("./assets/barchart3.png")} />
            <Text style = {styles.bigText}>Power Bill Data</Text>
            <Button
                title = "Add New Power Bill"
            />
            <Button
                title = "Remove Power Bill"
            />
            <Button
                title = "Go To Daily Tips"
                onPress={() => navigation.replace('Tips')}
            />
        </View>
    );
}
function dailyTipsScreen({navigation}) {
    return (
        <View style = {styles.container}>
            <Text style = {styles.bigText}>Daily Tips Screen</Text>
            <Button style = {styles.left}
                title = "Left"
                onPress={() => navigation.replace('Home')}
            />
        </View>

    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#f0e078",
        alignItems: "center",
        justifyContent: "center",
    },
    bigText : {
        fontSize : 50,
        marginBottom : 40,
        color : "#fff",
        fontFamily : "Futura-Medium",
    },

    image: {
        marginTop : -50,
        width : 200,
        height: 200,
        resizeMode: "contain"
    },

    inputView: {
        backgroundColor: "#f0eee1",
        borderRadius: 30,
        width: "70%",
        height: 45,
        marginBottom: 20,

        alignItems: "center",
    },

    TextInput: {
        height: 50,
        flex: 1,
        padding: 10,
        marginLeft: 20,
    },

    forgot_button: {
        height: 30,
        marginBottom: 30,
    },

    loginBtn: {
        width: "80%",
        borderRadius: 25,
        height: 50,
        alignItems: "center",
        justifyContent: "center",
        marginTop: 40,
        backgroundColor: "#f0eee1",
    },
    left : {

    }
});
const Stack = createNativeStackNavigator();

function App() {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                <Stack.Screen name="Login" component={loginScreen} />
                <Stack.Screen name = "Home" component = {homeScreen} />
                <Stack.Screen name = "Tips" component = {dailyTipsScreen} />
            </Stack.Navigator>
        </NavigationContainer>
    );
}
export default App;
